INSERT INTO `oprec_general` (`id_oprec_gen`, `id_oprec`, `id_major`, `id_lab`, `nim`, `motto`, `gpa`, `motivation`, `oprec_status`) VALUES
(1, 42, 1, 4, 1201184416, 'Pejuang Senyum Orang Tua', 3.78, 'I want to understand everything about statistics and be able to take part in several competitions about statistics.', 2),
(2, 45, 2, 12, 1202180305, 'Never get tired for learning new things.', 3.45, 'My motivation on applying to be a DESJAR practicum assistant is mainly because I keen on learning new things and focusing on my target in the future to work in the Network field. Another reason is for the experience. I also see this as a chance for me to share things with the other that maybe don’t know about it and I also hope I could learn new things and improve my skill if I got accepted.', 2),
(3, 45, 2, 12, 1202184045, 'Do The Best You Can Until You Know Better, hope all the best your life and believe god want to help you in you\'re situation and condition anything', 3.63, 'Maybe I\'m not an expert in networking but I will try to learn with capabilities that I have and will never despair because my parents always support my decision', 2),
(4, 38, 1, 3, 1201194062, 'Haus dengan pengetahuan', 3.65, 'Ingin memperdalam gambar teknik, dan membagikan ilmu yang sudah saya pelajari ke adik tingkat nantinya', 2),
(5, 38, 1, 3, 1201190176, 'Hakuna Matata', 3.9, 'im looking for experience of course, and also spending my time at dormitory for the next semester doesnt sound that exciting', 2),
(6, 39, 1, 2, 1201174288, 'Mending Cape Kuliah Daripada Cape Cari Kerja', 2.87, 'Karena saya tertarik dengan ke ilmuan ekonomi dan memiliki keinginan menjadi Ahli dalam bidang Finance maka dari itu saya telah menemukan tempat dimana saya bisa menambah ilmu tentang ekonomi di laboratorium Tekmi dan bisa membagikan ilmu tersebut kepada adik adik yang akan mengambil praktikum perancangan bisnis dan memiliki keinginan untuk dapat berkontribusi lebih untuk Lab. Tekmi dengan menjadi bagian dari Aslab Tekmi 2020', 2),
(7, 48, 2, 13, 1202184316, 'Success depends on your attitude and happiness depends on your gratitude.', 3.93, 'My interest in becoming an Object-Oriented Programming Practicum Assistant because I like teaching. I like to share knowledge with others because in my opinion if we give knowledge to others we will get more knowledge. In addition, I also want to deepen my knowledge in the field of Object-Oriented Programming. Therefore by becoming a Practicum Assistant, I hope I can get the experience of teaching and learn together with the other. Also, I can improve my soft skills too.', 2),
(8, 48, 2, 13, 1202184081, 'usaha tidak pernah menghianati hasil', 3.28, 'motivasi saya ingin menjadi asisten praktikum ialah untuk mengembangkan diri saya untuk berkomunikasi dengan baik dan juga untuk meningkatkan skill saya dalam pemrograman. karena menurut saya, cara untuk menjadi expert dalam bidang tersebut ialah dengan cara mengajarkan ke orang lain.', 2),
(9, 48, 2, 13, 1202184151, 'seek something new', 3.18, 'i want to find a new experience and deepen my knowledge in oop', 2),
(10, 48, 2, 13, 1202184026, 'success is achieved by doing', 3.91, 'Kesuksesan didapat karena kita melakukan apa yang harus dilakukan. sukses bukan berarti kita memiliki banyak harta, tetapi sukses adalah ketika kita mau melangkah menuju hal yang kita inginkan dan mendapatkannya', 2),
(11, 38, 1, 3, 1201194044, 'Kesuksesan itu dijemput, bukan ditunggu', 3.58, 'Just be yourself and you can be anything', 2),
(12, 38, 1, 3, 1201190013, 'just do what must you do', 1, 'because i am very love desain and do it in computer but i am must study and study to know how to make a perfect desain', 0),
(13, 48, 2, 13, 1202184132, 'jadilah orang yang jujur, karena dengan kejujuran akan mwmbawamu dalam keberhasilan', 3.68, 'saya ingin memperdalam lagi dan memberikan apa yang saya punya pada orang lain', 2),
(14, 48, 2, 13, 1202184132, 'jadilah orang yang jujur, karena dengan kejujuran akan membawamu dalam keberhasilan', 3.68, 'ingin memperdalam pengetahuan dan membagikan ilmu terkait oop yang saya punya', 0),
(15, 40, 1, 1, 1201170362, 'Do it like there\'s no tomorrow', 3.13, 'I wanted some thrilling journey in my life, I want to conquer my fear, create the memories. I wanted to challenge my limit and I want to be better. ', 2),
(16, 38, 1, 3, 1201190403, 'Life is all about helping each other', 2.38, 'I want to change my introvert personality and being a helpful person', 2),
(17, 48, 2, 13, 1202184044, 'Tetap tersenyumlah walau banyak orang lain menertawakan.', 3.72, 'Motivasi saya untuk mendapatkan sesuatu yang besar adalah keluarga saya. Karena, saya ingin keluarga saya terutama kedua orangtua saya melihat saya sukses dan bahagia. Karena motivasi saya adalah keluarga, saya selalu berpikir \"Lakukan yang terbaik demi keluarga\". Saya melakukan semuanya dengan senang hati atas dasar ingin melihat keluarga saya bangga terhadap saya. Tak lupa juga saya selalu memegang sebuah kalimat \"Allah tidak akan memberikan apa yang kamu inginkan, melainkan Allah akan memberi', 2),
(18, 48, 2, 13, 1202174127, 'If you didn\'t go for an opportunity that exists, you\'re no longer human being', 2.73, 'My motivation for applying the position is, I want to share my knowledge about Object Oriented Programming and Programming in general', 0),
(19, 55, 1, 10, 1201184186, 'Do a kindness right now!', 3.9, 'I am interested with the subject and I want to learn more about the subject.  After that I want to share it to other people. I also want to try new things and make my parents happy and proud.', 2),
(20, 47, 2, 13, 1202174324, 'Menjadi terbaik dari yang terbaik', 3.77, 'Ingin memberi ilmu yang kita miliki kepada orang lain ', 2),
(21, 52, 2, 11, 1202184117, 'risk everything or get nothing', 3.62, 'i\'m ready to take all the chances and learn a lot from it.', 2),
(22, 47, 2, 13, 1202174212, 'Lakukanlah yang Terbaik dan Bekerja Keraslah', 3.7, 'Motivasi saya yaitu untuk mengembangkan potensi diri, memperdalam ilmu, menambah wawasan dan dapat pengetahuan baru', 2),
(23, 45, 2, 12, 1202180139, 'Do what you can, whatever it takes!', 3.66, 'Semoga saya dapat menambah ilmu serta pengalaman yang akan digunakan saat bekerja nanti. Dan juga saya ingin membuat orangtua dan orang terdekat saya dengan prestasi dan pengalaman yang saya dapatkan,', 2),
(24, 47, 2, 13, 1202170015, 'Lakukan yang kamu suka', 3.26, 'Meningkatkan kualitas mahasiswa SI dalam bidang web development', 2),
(25, 38, 1, 3, 1201194224, 'You only live once, that\'s the motto!', 3, 'I want to learn more about it and maybe find out what I\'m really interested in', 0),
(26, 45, 2, 12, 1202180383, 'Do what you love, Love what you do', 3.65, 'Saya ingin membagi ilmu sambil belajar dan menguji diri saya sendiri dalam hal ilmu yang saya miliki dan kemampuan public speaking saya', 2),
(27, 38, 1, 3, 1201194190, 'Live once, dont think twice', 2, 'I just want to get some new experience and im interested with this lab', 2),
(28, 45, 2, 12, 1202184144, '\"Belum terlambat untuk menjadi apa pun yang kamu inginkan\" – George Elliot', 3.58, 'Hidup adalah sebuah perjuangan, oleh karena itu untuk memperoleh sebuah kesuksesan maka perlu belajar, berjuang, dan yang paling utama yaitu doa orang tua, serta memberi manfaat kepada orang lain walaupun hanya sedikit ilmu yang kita miliki.', 2),
(29, 48, 2, 13, 1202184003, 'Menjadi seperti kopi, saat tersiram didih air, semerbak aromanya.', 3.46, 'Ever tried, fail better, try again. Something that challenging, makes me feel alive.', 2),
(30, 40, 1, 1, 1201174306, 'Do Good and Good Will Come to You', 3.12, 'i want to be part of PFT LABZ, because this lab suits with my passion, and also i like something about the Facility and layout, so i want to contribute in this lab. And i hope if i join in this lab, it can improve my soft and hard skill, and get new experience to be PFT Assistant Laboratory', 2),
(31, 47, 2, 13, 1202174111, 'Mampu atau tidak mampu harus yakin kalo aku bisa diandakan untuk diriku sendiri dan untuk orang lain', 3.72, 'Ingin memperdalam ilmu yang saya minati yaitu dibidang programing, melatih skill saya terutama dalam public speaking dimana yang nantinya sangat saya butuhkan agar dapat berkomunikasi dengan orang lain, membagi ilmu yang saya punya kepada orang lain. ', 2),
(32, 48, 2, 13, 1202183313, 'Don\'t be afraid, just believe', 3.69, 'Jadilah kepala dan bukan ekor.', 2),
(33, 55, 1, 10, 1201183382, 'Life is a gift, but living is a choice', 3.79, 'my motivation is I want try to explore myself. I have an interest for the subject that this lab holding for since I was in high school. but I don\'t know where the right place to learn it. then, i want to go out from my comfort zone. Being an college student, i want to learn something valuable that affect to my future and my career and i think what we learn in this lab can bring something in the future especially for my future. ', 2),
(34, 55, 1, 10, 1201184175, 'They said you could not make it, prove them wrong.', 2.99, 'My motivation for applying in Ensyse Laboratory because i want to learn a new thing, being a college student is not only for studying, but its about try to challenge your self, because i want to learn something valuable from all of the significant events and people, i want to challenge my self to go beyond imposed limitations. Challenge and adversity are meant to help my self to know who i am.', 2),
(35, 55, 1, 10, 1201183441, 'KAIZEN', 3.63, 'Belajar lebih banyak, membuat dan mempererat relasi dengan orang baru dan menambah pengalaman semasa berkuliah serta menempatkan diri pada lingkungan yang saya anggap cocok dengan cara berpikir saya. Dan yang bisa saya janjikan adalah saya akan memberikan warna yang baru bagi suasana di lab dan juga implementasi hasil belajar saya dibidang akademik dan juga hasil belajar editing vidio selama setahun kebelakang.', 2),
(36, 45, 2, 12, 1202184321, 'Kesempatan hanya datang untuk orang yang mempersiapkan nya', 3.02, 'Selain untuk pengembangan diri sendiri saya akan memastikan praktikan saya dapat ilmu yang saya ajarkan', 2),
(37, 38, 1, 3, 1201190372, 'Do not ever regret your decision and live it as a gentleman', 4, 'Useful for the others, channeling hobbies, and develop myself to become a better person.', 2),
(38, 38, 3, 3, 1203193052, 'Teruslah mengejar mimpimu hingga suara cemo\'ohan itu berubah menjadi tepuk tangan', 2, 'Yang pasti motivasi saya mengikuti rekruitasi ini adalah karena saya memiliki kegemaran dalam hal design, ingin mencari pengalaman baru, dan belajar ilmu baru dibidang gambar teknik ini, karena saya rasa laboratorium gartek ini dapat mewadahin passion saya ini, selain itu juga alasan saya mendaftarkan diri sebagai asisten lab ini karena saya ingin bergabung menjadi bagian dari keluarga laboratorium gartek ini, dan juga mengamalkan ilmu yang saya dapat sebelumnya dipelatihan dengan cara, membimbi', 2),
(39, 45, 2, 12, 1202181252, 'A jack of all trades is a master of none, but oftentimes still better than master of one.', 3.81, 'Untuk memenuhi persyaratan program 3.5 tahun, Ingin mendapat pengalaman baru, mengasah skill mengajar, dan belajar berorganisasi serta time management. Selain itu, diri sendiri memang suka dengan materi jaringan komputer.', 2),
(40, 42, 1, 4, 1201184193, 'I have not failed, i\'ve just found 10000 ways that won\'t work', 3.58, 'I like statistics and want to gain more knowledge and be able to share knowledge', 2),
(41, 38, 3, 3, 1203190040, 'Big Dream Hard Work', 1.95, 'Motivasi saya untuk mengikuti rekruitasi ini adalah karena laboratorium gambar teknik adalah suatu lab yang mendalami tentang gambar teknik dan desain, mendapatkan pengalaman berharga dengan para assisten yang luar biasa di keluarga laboratorium gambar teknik dimana itu adalah hal yang saya sukai tentang desain gambar teknik, menjadikan lab gambar teknik adalah suatu wadah yang pas untuk saya bisa mengembangkan diri dengan softskill yang saya miliki dan menularkan aspirasi baru dikemudian nanti,', 2),
(42, 38, 1, 3, 1201194348, 'Think Big And Do It Now', 3.95, 'dapat mempelajari lebih dalam desain dalam gambar teknik, mengembangkan minat saya dalam gambar teknik, menambah wawasan mengenai ilmu gambar teknik maupun secara umum dan berbagi pengetahuan yang saya punya nantinya kepada teman-teman', 2),
(43, 40, 1, 1, 1201174278, 'All Is Well', 3.83, 'There was knowledge everywhere. Go get it from anywhere you can.', 2),
(44, 38, 1, 3, 1201190098, 'Just do it, everything will has it end.', 3, 'I have a big passion in graphic design, i also love all sort of things that\'s related to 2D art. Participating in GTX practicum help me discover my interest in 3D modelling. By applying, it motivates me to develop my interest in 2D and 3D design even more.', 2),
