(134, 40, 1, 1, 1201170360, 'Keep Moving Forward', 3.08, 'Becoming a laboratory assistant is a very proud thing and at the same time a burden especially for ordinary people like me who do not have experience in the field. My motivation is to become an assistant in PFT Laboratory is because my interest in those field. I want to find an experience and learn about new things that i have never had before, and also become part of the next big thing.', 2),
