(136, 39, 1, 2, 1201174182, 'Nothing Great Ever Comes Easy', 2.84, 'I’ve been experienced being in organizations and practice a lot about my soft skills and my leadership skills. The more I grow up, the more I realize my self that it is better to balance my Academic and non-Academic skills than being too focused on one thing. As I realized that I was always had the feeling of joy and fun studying the Techno Economy subject, I want to do more than just enjoy doing the progress report or help my friends when they needed me to. I want to give more to the lab.', 2),
(137, 52, 2, 11, 1202184085, 'Jadilah Diri Sendiri', 3.41, 'Selama masih berusaha dan tidak putus asa maka sebagai bonus dari usaha kita yaitu mendapatkan kesuksesan ', 2),
(138, 52, 2, 11, 1202184085, 'Jadilah Diri Sendiri', 3.41, 'Selama masih berusaha dan tidak putus asa maka sebagai bonus dari usaha kita yaitu mendapatkan kesuksesan ', 0),
