(140, 48, 2, 13, 1202184126, 'Have contribution to society even it\'s a small things', 3.97, 'OOP is a big concept in programming, learning it have big impact on my coding skills, it\'s like seeing whole big picture from a piece of code. With this position i hope that i can improve my lecturing stuff, since OOP is one of my most favorite lecture in third semester.', 2),
(141, 45, 2, 12, 1202184260, 'Every thing we choose to live alone and we must be prepared to accept the bitter and sweetness of the path we choose', 3.04, 'Always Live Life with a sense of enthusiasm if we fall or down we must remember for what we are here? what we want to achieve?, gather intentions earnestly waiting for ideals and pray to God!!', 2),
