(144, 38, 1, 3, 1201194079, 'motto hidup saya adalah selalu berdoa setiap saat, berusaha saat mengejar impian, selalu ikhtiar disegala keadaan, dan selalu tawakal ketika mendapatkan sesuatu yang tidak diharapkan. ', 2, 'saya ingin berbagi ilmu walau ilmu yang saya miliki hanya sedikit', 2),
(145, 38, 1, 3, 1201194222, 'Menjadi diri sendiri', 3.3, 'Saya ingin meningkatkan kemampuan saya dan juga ingin membantu orang banyak dengan kemampuan saya yang telah diperoleh', 2),
(146, 48, 2, 13, 1202183363, 'Berdoa, niat dan percaya diri adalah kekuatan sejati untuk memulai sesuatu', 3.75, 'Setelah menempuh perkuliahan di jurusan sistem informasi selama 4 semester ini, saya berharap ilmu, pengalaman, teman dan segala hal yang saya dapatkan dapat saya bagi ke teman teman semua sehingga semua yang saya dapatkan bisa bermanfaat bagi orang sekitar. Disamping saya membagikan hal tersebut, saya juga ingin belajar ke temen temen adik kelas maupun kakak kelas. Jadi disini kita saling membantu agar menjadi pribadi yang lebih baik.', 2),
(147, 0, 1, 0, 1201194222, 'Menjadi diri sendiri', 3.3, 'Ingin membantu orang banyak', 0),
(148, 49, 2, 16, 1202174002, 'kalau kita benar, kenapa mesti takut', 3.41, 'ingin melakukan kontribusi lebih bagi jurusan dan ingin mencoba hal baru diluar minat', 2),
(149, 52, 2, 11, 1202184138, 'Bermanfaatlah bagi orang lain, tapi jangan sampai di manfaatkan! ', 3.74, 'Like my motto, to help people u need to be a big people to help much people. ', 2),
(150, 52, 2, 11, 1202183291, 'stop complaining, start listening, start doing', 3.93, 'motivasi mengikuti asisten praktikum adalah sekalian belajar strukdat lagi apalagi ini phyton, sesuatu yang baru dan sepertinya akan sangat berguna di masa depan dan juga alasan mengapa mengikuti asisten praktikum tidak lain adalah agar mengurangi kegabutan dan merubahnya menjadi bermanfaat. agaknya sedikit klise namun mendapat uang juga sepertinya bisa dijadikan alasan mngikuti sebagai mahasiswa.', 2),
(151, 38, 1, 3, 1201194436, ' Whoever is serious, he will succeed', 3.5, 'I want to share my knowledge and experience', 2),
(152, 56, 2, 15, 1202172379, 'keep moving, keep growing, keep working and consistent', 3.35, 'Being an ERP\'s lab assistant is the next step to be an ERP consultant because I will get valuable lessons and knowledge compared to other people. Other than that, I want to build a broad relationship with great people in the ERP environment. In my opinion having a broad relationship is very important to help our life.', 2),
(153, 56, 2, 15, 1202172009, 'Eat, and you feel better', 3.3, 'Ingin bisa setinggi bintang, tetapi serendah mutiara didasar laut', 2),
(154, 56, 2, 15, 1202174005, 'Hidup itu tergantung pemikiran kita', 3, 'Menurut saya menjadi asisten praktikum merupakan suatu lagkah besar yang harus saya ambil untuk menuju masa depan yang lebih baik, selain itu saya merasa menjadi manusia yang berguna ketika saya dapat memberikan manfaat kepada orang lain. Karena itu dengan menjadi asisten praktikum saya siap belajar dan memberikan ilmu saya kepada orang lain.', 2),
(155, 56, 2, 15, 1202172141, 'Do your best and God will do the rest', 3.69, 'Motivasi saya menjadi asisten ialah karena saya ingin berbagi ilmu yang saya dapat ke banyak orang. Selain itu saya juga ingin menambahkan pengalaman mengajar, berorganisasi, serta memperdalam pemahaman saya dalam bidang ERP khususnya SAP.', 2),
(156, 56, 2, 15, 1202174219, 'NO PAIN, NO GAIN!', 3.55, 'To make a better, creative and innovative generation than previous generations. Pledge themselves to upgrade their technical skills even soft skills too.', 0),
(157, 40, 1, 1, 1201170420, 'Keep Moving Forward', 3.83, 'Ingin menambah wawasan, menambah pengalaman, dan menambah teman', 2),
(158, 56, 2, 15, 1202171116, 'You\'ll never know if you never try', 3.65, 'My motivation for applying this position is because i have to continue what i\'ve started. Because i am responsible and i would never stop to learning things and chalengging my self. And i love to share what i have such as knowledges and experiences to others.', 2),
(159, 48, 2, 13, 1202184327, 'Takut Gagal Bukan Alasan Untuk Tidak Mencoba Sesuatu', 3.75, 'motivasi saya mengikuti ini adalah untuk meningkatkan kemampuan saya dalam hal ngoding', 2),
(160, 56, 2, 15, 1202174239, 'Exploring new things', 3.77, 'Highly motivated and interested in business processes , projects and consultant. After graduation I would like to work in the field with related business processes, development, analysts and becoming a PM or consultant on a project.  as long as I study ERP, ERP has all sectors job, not only business and projects but there is branding, marketing, sales and others that can be other field of jobs. so that ERP is very broad and the job sector as well', 2),
(161, 38, 1, 3, 1201194003, 'Kenali dirimu dan banggalah dengan identitasmu sendiri. Karena tiap orang memiliki keunikannya masing-masing.', 3.58, 'Basic saya dari dahulu sangat suka dengan visual ruang atau membuat suatu bentuk benda. Semenjak adanya mata kuliah menggambar teknik, bakat saya bisa tersalurkan. Capek mungkin menurut sebagian orang, namun saya sangat suka dengan yang satu ini. Apalagi setelah saya mendapat nilai di atas rata-rata pada mata kuliah ini, sangat menambah motivasi saya untuk terus mengembangkan. Mungkin saya sangat terlambat untuk join sama research grup-nya, tapi dengan bergabung menjadi asisten laboratoriumnya, ', 2),
(162, 52, 2, 11, 1202184072, 'smile and be happy', 3.73, 'I want to improve my knowledge', 2),
(163, 40, 1, 1, 1201174173, 'Show the best of you', 3.59, 'Being someone who is beneficial to other ', 2),
(164, 55, 1, 10, 1201184316, 'you are what you think and you get what you do', 3.26, 'my biggest motivation. i just want to prove that i don\'t give up easily and will continue to try', 0),
(165, 55, 1, 10, 1201184275, 'Please lord, help me got one more', 3.63, 'Saya memiliki motivasi yang cukup kuat untuk membayar rasa penasaran dalam bidang enterprise system ini. Saya, juga memiliki pribadi yang senang akan hal-hal baru untuk dipelajari. Dengan latar belakang menjadi tim riset dari ensyse, saya yakin ini adalah kesempatan yang tepat untuk saya.', 0),
(166, 45, 2, 12, 1202184184, 'don\'t look above nor down, keep aiming your attention forward to achieve what you want.', 3.66, 'I want to make use of these knowledge i have learnt, plus since I have interact someone often in english, i\'d like to make use of this skill to complete the aforementioned motive.', 2),
(167, 45, 2, 12, 1202184235, 'Orang yang paling baik adalah orang yang paling bermanfaat untuk orang lain', 3.93, 'Mengajarkan sesuatu yang sudah dimiliki walaupun sedikit agar dapat bermanfaat untuk orang lain, kemudian menambah pengalaman dan belajar cara bekerja dalam kelompok.', 2),
(168, 39, 1, 2, 1201174210, 'Terus bergerak untuk hal yang benar', 3.26, 'Ingin menjadi pribadi yang mandiri, berkarakter, berguna bagi orang lain dan institusi, serta mampu membagi pengetahuan yang dimiliki.', 2),
(169, 42, 1, 4, 1201184424, 'Don\'t stop until you\'re proud', 3.9, 'I like to share knowledge with people and it makes me grow', 2),
(170, 38, 1, 3, 1201193354, 'stop wishing. start doing. travel harder.', 3.45, 'be a laboratory assistant is my chance to explore my knowledge. which is i would have any chance to work with skills in design. i also want to build relations and help others to get succees and achieve their goals.', 2),
(171, 46, 2, 12, 1202170044, 'Hasil tidak akan mengkhianati usaha', 3.67, 'Perlu adanya kegagalan ataupun penolakan jika ingin merasakan kesuksesan yang sesungguhnya. Jangan menyerah ketika kehilangan satu kesempatan. Teruslah berjalan walaupun lambat asal tak berhenti, pasti akan mengarahkan jalan menuju kesuksesan pada akhirnya.', 0),
