(176, 49, 2, 16, 1202174107, 'Do good, Be good', 3.5, 'Motivasi saya dalam mengikuti rekruitasi sebagai Asisten Praktikum Lab ISM ini adalah ingin memperluas pengetahuan saya mengenai IS Management terutama pada Management Layanan.', 2),
(177, 49, 2, 16, 1202174170, 'Do the best and pray. God will take care of the rest', 3.49, 'Motivasi saya adalah saya ingin menjadi mahasiswa yang aktif serta menambah dan memperdalam ilmu di bidang ISM dan juga saya ingin menambah pengalaman saya.', 2),
(178, 48, 2, 13, 1202184040, 'Accept, Think, Do It', 3.76, 'Ingin belajar lebih lagi dan menambah pengalaman dalam ajar mengajar, dan ingin berbagi pemahaman dan konsep\" saya dalam ilmu pengetahuan', 2),
