(183, 45, 2, 12, 1202184101, 'Dimana ada kemauan, disitulah ada jalan.', 3.16, 'Saya akan menjadi seseorang yang berguna bagi lingkungan sekitar maupun lingkup luas. karena salah satu cita-cita saya yaitu, ingin menjadi seseorang yang bermanfaat bagi orang lain, maka dari itu saya akan memanfaatkan kemampuan saya untuk bisa membantu orang lain dan memberi dampak positif bagi lingkungan sekitar maupun lingkup luas.', 2),
(184, 49, 2, 16, 1202174221, 'To get a success, your courage must be greater than your fear', 3.34, 'Menjadi asisten merupakan suatu kebanggaan, kepuasan diri , karena menjadi mahasiswa yang memanfaatkan waktu kuliahnya lebih bermanfaat , Mendaptkan Ilmu yang mendalam dan spesifik, asisten harus lebih dulumempersiapkan segalasesuatu yang sesuai dengan bidangnya. Ilmu yangmendalam ini yang akan menjadi modal utama asisten dan Interaksi lebih banyak dengan dosen akan menambahpengetahuan juga, karena tentunya opportunity untuk sering bertukarpikiran, sharing, berdiskusi menjadi terbuka lebar.', 0);
INSERT INTO `oprec_general` (`id_oprec_gen`, `id_oprec`, `id_major`, `id_lab`, `nim`, `motto`, `gpa`, `motivation`, `oprec_status`) VALUES
(185, 52, 2, 11, 1202180092, 'Jangan takut untuk mencoba, bagaimana kita mengetahui sesuatu jika kita takut untuk mencoba', 3.39, 'Berbagi ilmu tentang apa itu struktur data, bagaimana cara kita mengolah data, dan lain sebagainya, sehingga di dunia kerja nanti, kita dapat mengolah data dengan rapi, baik dan akurat', 2),
