(187, 52, 2, 11, 1202184062, 'be strong, be the best, keep going and be rainbow in someone cloud', 3.81, 'Never let it rest -St Jerome\r\nbecause to be the best, we need beyond the best.', 2),
(188, 47, 2, 13, 1202171206, '\"Coba dulu, kalau gagal, coba lagi\"', 3.84, 'Motivasi saya menjadi asistem praktikum WAD adalah ingin terus mengembangkan hardskill yang saya pelajari sebelumnya, karna dengan menyampaikan materi pada orang lain, hal itu juga dapat membuat saya untuk semakin mencari lebih dalam tentang pengetahuan tersebut. Selain itu, saya juga ingin membangun relasi dan melatih softskill saya seperti public speaking, time management, dan kemampuan untuk bekerja secara tim.', 2),
(189, 47, 2, 13, 1202174034, 'hidup untuk berbagi', 2.84, 'saya ingin membagikan ilmu yang saya miliki untuk adek adek', 0),
(190, 38, 1, 3, 1201194159, 'hidup dibuat enjoy aja', 3.8, 'Ingin memiliki pengalaman dan pengetahuan lebih tentang gambar teknik', 2),
(191, 38, 1, 3, 1201194051, 'Intention, effort, prayer', 3.95, 'I want to upgrade my public speaking, get something new, and expert on Autodesk Inventor ', 2),
(192, 56, 2, 15, 1202174302, 'Work with all your heart,  as doing it  for the Lord, not for people', 3.85, 'I am sure it would strongly enrich my future studies and help me in my prospective career. Where, I can add my insights about ERP especially knowing more about Odoo and all the other of ERP software, be a place that I can study and get several experiences to attend some competition and also to share my talents and knowledge with others. Because at the same time, when I get the opportunity to be lecturer assistant in Discrete Mathematics, I feel enjoy wherein I can teach and share my knowledge to', 2),
(193, 49, 2, 16, 1202170289, 'Lupakan masa lalu, abaikan masa depan, lakukan yang terbaik hari ini.', 3.23, 'Motivasi saya mendaftar menjadi asisten praktikum manajemen layanan adalah mewujudkan visi dan misi praktikum manajemen layanan. Dengan melakukan studi didalamnya. Selain itu, tujuan saya menjadi asisten praktikum manajemen layanan agar ilmu yang saya dapat, bermanfaat bagi diri saya sendiri maupun orang lain. Saya yakin, dengan masuknya saya sebagai asisten praktikum manajemen layanan menjadi salah satu faktor yang dapat mewujudkan visi dan misi dalam menjalankan praktikum yang lebih baik.', 2),
(194, 38, 1, 3, 1201190202, 'Only fools use their mouth to speak. A smart man uses his brain, and a wise man uses his heart.', 3.85, 'Practicing and sharing with many people makes me a reliable expert. The above is a good thing, if we do good then it goodness returns to us multiplied according to the will of God', 2),
(195, 38, 1, 3, 1201194066, 'Hidup dibikin asik aja ', 3.5, 'stay focus and more productive', 2),
(196, 48, 2, 13, 1202183370, 'Jangan takut mencoba hal baru. meskipun gagal, setidaknya kita telah mencoba.', 3.6, 'Ingin mengembangkan minat dan softskill serta ingin berbagi ilmu yang telah saya punya sehingga dapat lebih bermanfaat bagi banyak orang.', 2),
(197, 47, 2, 13, 1202174372, 'Work hard, pray hard.', 3.74, 'Generally I like teaching. But beside that, I also want to improve my skill in web programming.', 2),
(198, 38, 1, 3, 1201190344, 'Finish what you started', 3.9, 'I want to make my parents proud and I want to share my knowledge too', 2),
(199, 48, 2, 13, 1202174246, 'go hard or go home', 3, 'learn the latest, experience and everything that I see', 2),
(200, 46, 2, 12, 1202170265, 'i don\'t wanna be perfect,but i wanna be the best ', 3.24, 'Becoming a Practicum Assistant is one of my goals in college. In addition to intending to worship because of Allah, being a Practical Assistant gets a positive side as well as having an impact on the development of public speaking, mastery of the material, teamwork among fellow students, time management, and more importantly sharing knowledge and helping practice if there are problems in the practicum. I have a life motto that is \"I don\'t want to be perfect but I want to be the best\" I know I ca', 2),
(201, 38, 1, 3, 1201190011, 'Believe in God\'s Will', 3.95, 'I want to be in a situation that can provide a zone between the comfort zone and the danger zone.', 2),
(202, 47, 2, 13, 1202172073, 'Keep going because life goes on', 3.71, 'I want to contribute and be useful when I become the practicum assistant.', 2),
(203, 46, 2, 12, 1202170063, 'ingat selalu kita diciptakan untuk apa', 3.49, 'memberikan ilmu yang kita peroleh dan mengajarkannya ', 2),
(204, 40, 1, 1, 1201174356, 'Percuma jadi pinter jika hanya untuk menganggap orang lain \'bodoh\'', 2.72, 'tidak ada motivasi khusus, saya hanya ingin merasakan menjadi orang yang berguna walau hanya dilingkungan fakultas sendiri. selebihnya mungkin karna saya ingin lebih belajar dan memahami bidang ini. Saya terbilang terlambat untuk masalah \"Aktif\" dikampus, tapi saya percaya perjalanan ribuan mil berawal dari satu langkah.', 2),
(205, 43, 1, 5, 1201184058, 'Jangan tunggu bahagia baru bersykur, bersyukurlah maka kamu akan bahagia', 3.28, 'Menjadi Inspirator yang dapat memotivasi orang untuk menjadi lebih baik ', 2),
