(208, 48, 2, 13, 1202184129, 'Percaya bahwa segala skenario Tuhan lebih baik dari yang kita bayangkan', 3.42, 'Saya percaya bahwa saya seperti atom, sebagai manusia yang dianggap kecil namun dapat memberikan ledakan yang dahsyat.', 0),
(209, 38, 1, 3, 1201194019, 'Start from easy one to understand the difficulties', 3.4, 'I still beginner in design but I really enjoy to study it. I also want to increase my softskill because I understand that we have to interact with people. If I join the laboratority assistants, I think it will expand the way I thinking and make me upgrade myself', 2),
