(213, 45, 2, 12, 1202183353, 'mungkin tidak sekarang, tapi nanti.', 3.45, 'one of my dream is become a teacher/lecturer. so, by this recruitment as practicum assistant i can practice myself how to deliver my acknowledge to someone else in the right way and i will be able to experience of being a \'teacher\'', 2),
