(218, 45, 2, 12, 1202184267, 'Tidak ada yang tidak mungkin, pasti selalu ada solusi dan celah untuk mencapainya.', 3.38, 'Selalu tanamkan sikap semangat dalam melakukan sesuatu, tak peduli sesulit apapun itu.', 2),
(219, 38, 1, 3, 1201194277, 'Life is boring if you are not tried.', 3.58, 'i want to learn more, want to share everything that i learn.', 0),
(220, 45, 2, 12, 1202184087, 'Kegagalan bukan akhir dari segalanya, melainkan lembaran baru untuk hal yang baik', 3.61, 'Motivasi saya untuk mendapatkan suatu hal besar adalah orang tua sekuat apapun saya bertahan orang tua saya lebih kuat , saya mencoba menggapai semua mimpi saya karena harapan orang tua yang besar terhadap saya , saya bisa melewatinya dan bisa menghadapinya karena dukungan mereka, dengan dukungan dan kerja kerasnya saya yakin saya akan menjadi hal yang besar untuk membanggakan kedua orang tua saya.', 2),
(221, 46, 2, 12, 1202174175, 'Atur Sholatmu dan Allah akan membantumu mengatur segalanya', 3.64, 'Asprak menurut saya juga bisa menjadi ladang ilmu karena dengan membantu, selain kita berbagi ilmu ternyata dapat membuat ilmu yang saya punya menjadi lebih bermanfaat dan ke improve ketika ada praktikan yang bertanya dan juga jika ada troubleshooting. Selain itu hal ini berkaitan dengan motto saya yaitu “ Bermanfaat dan berbagi semampu yang saya bisa dan taat kepada Allah “ . dimana dengan mengajar saya merasa lebih berguna karena bisa menyebarkan ilmu yang saya mampu serta ibadah di jalan Alla', 0),
(222, 43, 1, 5, 1201180348, 'Do good things and just try', 2.68, 'My motivation be an assistant is because I wanna be professional engineer and I hope I can understand more about production system and automation. Also I want to help others so they will understand about production system itself.', 2),
