(522, 62, 2, 11, 1202194328, 'Jangan Sok Tahu, Karena Allah Yang Maha Tahu', 3.89, 'motivasi saya untuk mendaftar sebagai asisten praktikum mata kuliah algoritma dan pemograman adalah saya ingin menambah ilmu saya sebagai seorang mahasiswa, karena ketika seseorang mengajarkan suatu hal yang bermanfaat maka orang tersebut akan mendapatkan ilmu juga. jadi disamping menambah ilmu saya juga memberi ilmu kepada adik tingkat nantinya.', 2),
(523, 62, 2, 11, 1202190126, 'jalani dan hadapi segala rintangan', 3.5, 'Saya ingin mempelajari ulang dan dapat meneruskan ilmu yang saya dapat saat semester 2 dan dari bimbingan nanti, adanya sharing antar sesama asisten dan praktikan. Selain itu, saya dapat melatih diri dalam berkomunikasi yang lebih baik, menjadi orang yang bermanfaat dalam pembelajaran pemograman, belajar untuk membimbing atau mengajarkan orang lain dalam pelajaran pemograman.  ', 2),
(524, 61, 2, 11, 1202184085, 'Jadilah Diri Sendiri', 3.47, 'Selama masih berusaha dan tidak putus asa maka sebagai bonus dari usaha kita yaitu mendapatkan kesuksesan', 0),
(525, 61, 2, 11, 1202184259, 'Guru terbaik adalah pengalaman', 3.44, 'Motivasi saya mengikuti Asisten praktikum ini memberikan pengetahuan serta pengalaman yang saya miliki kepada para praktikan yang sedang mengambil matakuliah basdat serta memberikan motivasi kepada mereka bahwa basdat merupakan ilmu yang sangat penting bagi yang tertarik di bidang data', 0),
(526, 61, 2, 11, 1202184062, 'be strong, be the best, keep going and be rainbow in someone cloud', 3.82, 'Honestly my family, especially my mom.', 0),
(527, 62, 2, 11, 1202190203, 'Cukup Allah sebagai penolong dan pembimbingku', 3.76, 'Motivasi saya ingin menjadi Asisten Lab untuk Praktikum APLRO adalah karena saya ingin memiliki pengalaman lebih selama kuliah, saya ingin memiliki pengalaman menjadi seorang asprak, saya juga ingin berbagi ilmu dan bermanfaat kepada orang lain. Selain itu saya juga ingin memperluas relasi karena bisa berkenalan dengan para asprak lain dan juga bisa berkenalan dengan mahasiswa yang sedang praktikum Alpro.', 0),
(528, 61, 2, 11, 1202184072, 'smile and be happy', 3.73, 'i want to be basis data assistant practicum', 2),
(529, 63, 2, 14, 1202184237, 'Hidup bukan saling mendahului, bermimpilah sendiri-sendiri.', 3, 'The main reason why I want to apply as the practicum assistant because I think one of the best way to learn is to share our knowledge, by become a practicum assistant I will also experience to teach and learn together with the practitioner later and I also can improve my communication and public speaking skill.', 2),
(530, 62, 2, 11, 1202194271, 'Jangan \'gimana nanti\', tapi \'nanti gimana\'!', 3.75, 'Ingin mempunyai pengalaman menyalurkan ilmu serta kemampuan yang saya miliki saat menjadi asisten praktikum.', 2),
(531, 62, 2, 11, 1202190052, 'If something’s important enough, you should try. Even if you the probable outcome is failure', 3.76, 'Saya ingin membagikan pengetahuan yang saya miliki kepada banyak orang dengan baik. Saya ingin bisa mencari cara untuk menjelaskan dengan cara yang mudah dimengerti orang lain dan disamping itu juga saya ingin mengasah skill programming dengan lebih baik lagi.', 2),
