(534, 62, 2, 11, 1202194346, 'Mari kita hidup dengan nyaman', 3.88, 'Saya ingin belajar lebih dan mendalami bidang ini, bermanfaat bagi banyak orang, dan membagikan ilmu yang pernah saya dapatkan kepada banyak orang agar berkah.', 2),
(535, 62, 2, 11, 1202190321, 'Kerjakanlah yang harus dikerjakan terlebih dahulu agar bisa besenang senang kemudian', 3.89, 'Saya ingin sharing semua pengetahuan yang saya punya serta dengan saya mensharing saya juga bisa mendapat ilmu baru dan bisa lebih memahami hal yang sudah saya sharing.', 2),
(536, 61, 2, 11, 1202184020, 'berusahalah semaksimal mungkin, selama yakin bisa pasti bisa.', 3.64, 'Motivasi saya dalam mengikuti rekruitasi asisten praktikum BASDAT ini adalah ingin mengembangkan skill semakin banyak berlatih semakin terkuasai, menambah ilmu dan pengetahuan, belajar bersama serta mededikasikan diri pada fakultas  untuk membimbing dan mengajar teman-teman praktikan.', 0),
(537, 62, 2, 11, 1202190355, 'I don\'t have one because in my opinion life is wide to be defined by a single motto ', 3.72, 'I apply for this position because I want to deepen my knowledge and experience.', 0),
(538, 63, 2, 17, 1202184190, 'Teruslah berlatih untuk menjadi orang sukses', 3.41, 'I want to be a RPB Practicum Assistant because I am interested in SAG specialization, especially on business processes. Business process is the most important part for any company. Even though I only did it once in a big RPB task, I like the method of doing business process engineering in the company with the aim of achieving an effective and efficient business process. I want to learn more about it and I want to have hard skills related to business processes.\r\n\r\nI think I can be a RPB Practicum', 2),
(539, 62, 2, 11, 1202190028, 'Whatever things happen, even if you don\'t know how it ends, keep doing what you\'ve started until its finished.', 3.93, 'My motivation for being the next big things in this case being the Algorithm and Programming Practicum Assistant is because i want to improve my soft skill and hard skill. I also want to share my knowledge to my junior as well as i learn from them too. The other motivation for being the Next Big Things is to encourage myself to grow up and looking for relationship possibility that can be my advantage in the working world :)', 2),
