(564, 62, 2, 11, 1202194364, 'bermimpilah setinggi langit. Jika engkau jatuh, engkau akan jatuh di antara bintang-bintang', 3.83, 'Saya merasa ilmu yang saya miliki dapat berguna untuk orang lain. Dan jika saya di terima menjadi aslab, saya bisa menghabiskan waktu saya untuk hal yang lebih berguna.', 2),
