(570, 65, 2, 12, 1202184057, 'Dream, seek, achieve', 3.65, 'Bisa menyalurkan imipian saya dalam bidang jaringan dan komputer dan bisa membuat sebuah inovasi baru untuk Lab Sisjar , serta bisa menyalurkan ilmu ilmu yang sudah saya dapat untuk sekitar. Dan semoga dengan mengikuti calon asisten Manjarkom 2021 saya bisa berkontribusi lebih baik untuk Lab Sisjar.', 0),
