(575, 63, 2, 14, 1202184221, 'Ulah Kumeok Samemeh Dipacok!', 3.33, 'Starting from a vacation one year ago, I asked my father about my major. My father shared his opinion\r\nwith me. He gave me two options, the first is Information Systems Management in Enterprise Systems\r\nArchitecture and the second is Enterprise Data Management in Enterprise Systems Development. So, I\r\nstarted thinking about any opportunities that could improve my abilities. After that, I began to make my\r\nfirst and only choice, namely the ISM Laboratory. But right at the end of the fourth semest', 0),
