(582, 66, 2, 12, 1202174368, 'Berusahalah diatas rata-rata!', 3.29, 'Motivasi saya mendaftar asprak KSI ini adalah yakni tentunya menyesuaikan dengan peminatan saya yaitu EIM, dan juga pasti ingin memperbagus portofolio dengan menambah pengalaman dan juga softskill.', 0),
