(594, 66, 2, 12, 1202170229, 'do good and good will come to you', 3.27, 'Saya telah menjadi salah satu dari orang-orang yang terpilih sebagai mahasiswa Universitas Telkom tahun 2017 di jurusan Sisten informasi, hal ini merupakan suatu yang sangat saya syukuri. Selama saya menjalani kehidupan sebagai mahasiswa, banyak sekali pandangan baru yang membuat saya tersadar akan perlunya perubahan pada diri saya agar dapat menjadi pribadi yang lebih baik lagi. Terlebih lagi tentang pentingnya bersosialisasi atau beroraganisasi dengan banyak orang. Saya tidak ingin menjadi mah', 0),
