(612, 58, 1, 9, 1201183321, 'Nothing is Impossible', 3.87, 'Saya ingin mengembangkan analisis saya di bidang pengembangan produk dimana hal tersebut sedang saya minati. Selain itu, saya ingin mencari pengalaman dan relasi di P-Dev Laboratory.', 2),
