(711, 57, 1, 7, 1201180162, 'Live a life like a squishy toys. Doesn\'t matter how much pressure you got, you need to get up as quick as possible', 3.62, 'I believe that life is about moving from one home to the another one. A house that ties bond and a home that makes me grow up. Back in 2019, when I became a SCOREP member, I saw a home figure in the SIMBI Lab. A place that gave me a lot of experience and made a great impression. Being a lab assistant is a new thing for me. So I try to get out of the box and answer the challenge in order to increase experience, abilities, and relationships. Also as a provision for my future knowledge.', 2),
