(718, 57, 1, 7, 1201184259, 'Be afraid and do it anyway', 3.8, 'Saya ingin mendapatkan pengetahuan lebih di bidang pemodelan sistem dan simulasi, mendapatkan pengalaman, memperluas relasi dengan dosen, senior, junior, dan juga teman seangkatan, serta saya ingin meningkatkan skill public speaking saya menjadi lebih baik lagi.', 2),
(719, 58, 1, 9, 1201183305, 'Ora Et Labora', 3.3, 'Menjadikan kesempatan terbaik untuk aktif dan menggali potensi diri, dapat membagi ilmu pengetahuan yang dimiliki untuk orang lain, menambah kapasitas diri dengan berinteraksi antar tim, saling mendengar dan memberikan pendapat, serta membangun laboratorium Product Development jauh lebih baik lagi dari sebelumnya karena akan banyak tantangan kedepannya dan saya sangat ingin ambil andil dalam menghadapi tantangan tersebut.', 2),
(720, 58, 1, 9, 1201180248, 'orang lain bisa sukses kenapa kita tidak ', 3.28, 'Saya ingin memahami lebih dalam mengenai product development serta ingin mencoba hal baru ', 2),
(721, 58, 1, 9, 1201184011, 'do the best and never give up', 3.92, 'do my best and always looking for the better future', 2),
(722, 58, 1, 9, 1201184255, 'do good without needing a reason', 3.4, 'I want to share knowledge and searching for knowledge ', 2),
(723, 59, 1, 8, 1201194436, ' Whoever is serious, he will succeed', 3.48, 'I want to share my knowledge and experience', 2),
(724, 59, 1, 8, 1201190343, 'Merendah bukanlah yang terendah', 2.45, 'saya ingin lebih berguna dan bermanfaat bagi orang lain', 0),
(725, 59, 1, 8, 1201194299, 'Whatever the result... Keep doing the best you can ', 3.3, 'Many things that have motivated me, so far.. I want to help each other, share knowledge, contribute to Telkom and etc. But the thing that the most motivates me is as the first daughter who doesn\'t have siblings. Why? Since I was the only and hope of my parents, I should be able to make them proud. Of course I have many ways to make my parents proud. Whatever the way, as long as I\'m comfortable and enjoying it I will face it because the happiness of my parents is also my happiness.', 2),
(726, 59, 1, 8, 1201194105, 'the best revenge by improving yourself', 3, 'because I have a deeper interest in APK & E and I like it. I hope to joining APK & E can add to my experience in college', 2),
(727, 59, 1, 8, 1201194356, 'jangan takut untuk selalu mencoba hal yang baru meskipun itu sulit untuk saya hadapi', 3.45, 'I want to improve my knowledge', 0),
(728, 59, 1, 8, 1201194165, 'semua yang aku lakukan tujuannya adalah untuk membuat ibuku bangga ', 3.45, 'membuat bangga diri sendiri dan ibuku', 2),
(729, 59, 1, 8, 1201190389, 'jika kamu ingin mimpi kamu terwujud, hal pertama yang harus kamu lakukan adalah bangun dari tidur mu', 3.25, 'saya ingin sekali menjadi asisten laboratorium APK&E untuk mempelajari ilmu yang sudah saya pelajari sebelumnya lebih dalam dan lebih mendetail lagi. menurut saya jika saya ingin menjadi asisten lab tersebut maka saya harus melakukan hal yang mendorong saya untuk mewujudkan keinginan saya. seperti moto hidup saya yang berbunyi jika kamu ingin mimpi mu terwujud makan hal pertama yang kamu lakukan adalah bangun dari tidurmu. maksud dari kata-kata bangun dari tidur mu adalah kita melakukan hal yang', 2),
(730, 57, 1, 7, 1201180130, 'Work hard until you reach your goals.', 2.91, 'I want to make a good thing with all of my knowledge', 2),
(731, 57, 1, 7, 1201184408, 'Everything that happens has a lesson', 3.64, 'I want to deepen my knowledge about business processes and simulation since I have an interest in those topics. So I can apply my knowledge to my final report or my job someday.', 2),
(732, 57, 1, 7, 1201182464, 'I WILL AND I CAN', 3.09, 'Menjadi mahasiswa merupakan kesempatan yang baik untuk menggali potensi kita lebih dalam. Pengetahuan tidak\r\nhanya didapat melalui perkuliahan di kampus, namun banyak cara untuk menimba ilmu,\r\napalagi jika kita mampu membagi ilmu yang kita ketahui dengan orang lain. salah satu caranya adalah dengan\r\nmenjadi asisten laboratorium, disini saya tertarik menjadi asisten laboratorium di simbi.\r\nKarena saya pikir itu akan menjadi pekerjaan yang hebat dan sesuatu yang unik bagi saya. Menjadi asisten mem', 2),
(733, 69, 1, 6, 1201194027, 'Just do your best', 3.95, 'I want to learn more and share my knowledge and experience', 2),
(734, 69, 1, 6, 1201190152, 'Panic when it\'s time', 3.33, 'Interesting lab, not only teach whats useful for the world of work but also for the daily life', 0),
(735, 72, 3, 10, 1202184003, 'Menjadi seperti kopi, saat tersiram didih air, semerbak aromanya.', 3.54, 'Ever tried, fail better, try again. Something that challenging, makes me feel alive.', 0),
(736, 72, 2, 10, 1202184161, 'Menjadi pembelajar sepanjang masa', 3.34, 'Saya ingin meningkatkan soft skill dengan cara mengajar, bersosialisasi dengan teman di lab dan praktikan di praktikum, dan saya juga ingin mencari relasi di lab dan praktikum ini.', 2),
(737, 72, 2, 10, 1202184093, 'Trust the process and you\'ll be better person', 3.91, 'Mau memiliki pengalaman belajar dan mengajar baru dan keluar dari zona nyaman.', 2),
(738, 72, 2, 10, 1202183370, 'jadilah manusia yang bermanfaat untuk orang lain dan lingkungan', 3.58, 'Motivasi saya dalam mendaftar sebagai asisten praktikum APSI yaitu saya ingin menjadi bagian dari keluarga laboratorium ESD, bekerja dalam tim, berguna bagi orang lain, dan mengembangkan softskill saya. Selain itu saya ingin membagikan ilmu yang sama miliki dan saya dapatkan kepada orang lain.', 2),
(739, 72, 2, 10, 1202184086, 'bersyukur ', 3.63, 'untuk bisa berbagi kebermanfaatan dalam ilmu pengetahuan', 2),
(740, 72, 2, 10, 1202184145, 'Carpe Diem (Seize The Day)', 3.53, 'i want to share my knowledge and learn new thing', 2),
(741, 72, 2, 10, 1202183313, 'Show the best part of me', 3.64, 'Ingin membantu mempermudah kehidupan sekitar dengan ilmu yang saya miliki.', 2),
(742, 72, 2, 10, 1202180373, 'Kamu jangan banyak minder, banyak hal dari kamu yang bisa kamu banggakan', 3, 'Ingin melakukan hal yang berbeda dan diluar zona nyaman saya.', 2),
(743, 72, 2, 10, 1202184266, 'Manjadda wajadda', 3.69, 'To measure the material that I have and then get an experience for my Portfolio ', 2),
(744, 72, 2, 10, 1202181105, 'don\'t depend on others but rely on yourself', 3.9, 'to develop both hard skills and soft skills and where I can learn and teach at the same time and to gain experience', 2),
(745, 72, 2, 10, 1202181054, 'mengusahakan yang terabaik di semua hal', 3.59, 'ingin membagikan ilmu dan meningkatkan relasi antar sesama anggota', 2),
(746, 72, 2, 10, 1202184365, 'Jangan pernah menunggu waktu yang tepat, tetapi ciptakan waktu yang tepat.', 3.42, 'Menambah relasi, ilmu dan pengalaman', 2),
(747, 72, 2, 10, 1202183363, 'Berdoa, niat dan percaya diri adalah kekuatan sejati untuk memulai sesuatu', 3.68, 'Setelah berkesempatan menjadi asisten praktikum OOP kemarin, saya merasa masih memiliki banyak kekurangan baik personal maupun kinerja dalam mengajar. Saya berharap dengan menjadi asisten praktikum APSI saya bisa berkembang lebih jauh lagi sehingga kekurangan saya bisa di minimalisir dan kelebihan serta kinerja saya bisa saya optimalkan. Semoga dengan diterimanya saya sebagai asisten praktikum APSI, saya bisa menjadi pribadi yang lebih baik lagi dan ilmu serta pengalaman saya yang sekiranya berm', 2),
(748, 72, 2, 10, 1202183364, 'No matter what, Trust God.', 3.84, 'Contribute to my major and personal development', 2),
(749, 72, 2, 10, 1202184091, 'Bisa tidak bisa, harus bisa', 2.97, 'Saya ingin membimbing dan membantu dalam memahami praktikan mengenai praktikum APSI', 2),
(750, 72, 2, 10, 1202184210, 'Berpikir tanpa henti, Berprestasi setiap hari', 3.63, 'Sejatinya dalam diri saya, keproduktifan dalam pribadi dimulai dari hal kecil ketika hal kecil tersebut sudah dapat dilakukan dengan sempurna bersiap untuk masuk ke hal yang lebih besar dan memulai aktivitas yang lebih terstruktur, mencatat dan mengatur tujuan saya merupakan hal yang wajib direalisasikan dan saya sering melakukannya 95% berhasil saya wujudkan. \r\n\r\nBagi saya ilmu itu seperti dari hulu ke hilir yang dapat diartikan dalam diri saya bahwa ketika saya masih berada di lingkup kecil sa', 2),
(751, 72, 2, 10, 1202184332, 'Pentingkan dulu diri sendiri, sebelum mementingkan orang lain', 3.12, 'Semoga kedepannya lebih baik lagi', 2),
(752, 72, 2, 10, 1202184151, 'keep things simple', 3.15, 'agar dapat lebih mengenal Apsi dan penerapannya dalam pekerjaan', 2),
(753, 72, 2, 10, 1202184249, 'bekerja keras dan bersikap baik', 3.49, 'menambah pengalaman dan dapat menyampaikan ilmu yang didapatkan', 2),
(754, 72, 2, 10, 1202180195, 'work hard play hard', 3.86, 'punya kehidupan yang nyaman', 2),
(755, 72, 2, 10, 1202184134, 'A Winner is Just a Loser Who Tried One More Time', 3.22, 'Ingin mendapatkan pengalaman menjadi seorang mentor', 0),
(756, 72, 2, 10, 1202183351, 'Jangan merendahkan orang lain', 3, 'Pantang menyerah sebelum mencoba dan belajar dari kesalahan', 2),
(757, 72, 2, 10, 1202184327, 'Takut Gagal Bukan Alasan Untuk Tidak Mencoba Sesuatu', 3.77, 'motivasi saya mengikuti ini adalah untuk meningkatkan kemampuan saya dalam menganalisis dan merancang sebuah sistem', 2),
(758, 72, 2, 20, 1202184112, 'Never give up and stay humble', 3.73, 'Motivasi saya mendaftar sebagai asisten praktikum APSI adalah untuk menambah pengalaman dan meningkatkan kemampuan saya.', 2),
(759, 72, 2, 10, 1202183345, 'jangan pernah goyang pada prinsip yang  ada pada diri kita karena prinsip itulah yang membuat kita menjadi orang yang teguh pendirian', 3.42, 'jangan pernah membanding bandingkan diri kita dengan orang lain karena setiap orang itu mempunyai keunikan masing masing', 0);
